import Button from "react-bootstrap/Button";
import Card from "./../../components/Card/Card.jsx";
import "./Home.css";

const Home = () => {
    return (
        <div className="d-flex flex-column min-vh-100 overflow-hidden">
            <main className="flex-grow-1">
                <section className="section1 d-flex justify-content-center align-items-center">
                    <div className="text-center">
                        <p style={{fontWeight: "lighter"}}>Your Future Unlocked</p>
                        <Button className="discover-btn" variant="outline-light">
                            Discover Courses
                        </Button>
                    </div>
                </section>
                <section className="section2 d-flex justify-content-evenly p-5">
                    <img src={require("../../assets/bg-3.jpg")} alt="bg" className="bg-image"/>
                </section>
            </main>
        </div> 
    );
};

export default Home;
